import React from 'react';
import classes from './Menu.css';
import MenuItem from './MenuItem/MenuItem';
import {NavLink, HashRouter} from 'react-router-dom';

const Menu = (props) => (
    
        <HashRouter>
            <div className={classes.Menu}>
                <NavLink exact to='/'><MenuItem>Home</MenuItem></NavLink>
                <NavLink to='/portfolio'><MenuItem>Portfolio</MenuItem></NavLink>
                <NavLink to='/about'><MenuItem>About</MenuItem></NavLink>
                <NavLink to='/contact'><MenuItem>Contact</MenuItem></NavLink>>
            </div>
        </HashRouter>

)

   

export default Menu;
